import React, { Component } from 'react'

import 'bootstrap/dist/css/bootstrap.min.css'

export default class Card extends Component {
  render() {
    return (
      <div class="card">
      <div class="card-header">
         {this.props.headerText}
      </div>
      <div class="card-body">
         {this.props.bodyText}
         <p class="card-text">
            {this.props.cardText}
         </p>
      </div>
      </div>
    )
  }
}
